import React from "react";
import classes from "./Footer.module.scss"

const Footer = (props) => {


    return(
        <section> className={classes.footer_container}>
            <div className={classes.footer_block}>
                <div className={classes.footer_clevr_followUs}>

                </div>
                <div className={classes.footer_quick_links}>

                </div>
                <div className={classes.footer_customer_area}>

                </div>
                <div className={classes.footer_customer_area}>

                </div>

            </div>
        </section>
    )
}

export default Footer;
